import React, {Component} from 'react'

class Profile extends Component {
	render() {
		return (
			<div class="ui divided items">
				<div class="item">
					<div class="ui avatar circular image"><img src="/images/wireframe/image.png"/></div>
					<div class="content"><a class="header">Content Header</a>
					<div class="meta"><span>Date</span><span>Category</span></div>
					<div class="description">A description which may flow for several lines and give context to the content.</div>
				</div>
			</div>
			</div>
		)
	}
}

export default Profile
